  return (
    <article className="post" data-testid="post">
      <div className="post__header">
        <div className="user">
          <Link to={`/`}>
            <img src="https://viniciusvinna.netlify.app/assets//api-instagram/profiles/black-panther/black-panther-profile.jpg" alt="T'Challa"/>
          </Link>
        </div>
      </div>
    </article>
  );
};

export default Post;
